      fetch('/diaries').then(res => {
          if(res.ok) {
              return res.json()
          }
      }).then(jsonRes => setDiaries(jsonRes))
  })
      return (
          <div>
            {diaries && diaries.map((diary) => {
                return <Diary key={diary._id} diaries={diaries} />
            })
            }
         </div>


